    false,nt"url": null,nt"notes": "There are three measures available on the
    portal for oral health hospitalizations.rnrn1.  Number of Visits u2013 The count
    of hospitalizations with a principle diagnosis code for oral health.rn2.  Crude
    Rate per 10,000 u2013 Rate calculated by dividing the number of hospitalizations
    by the total census population and multiplying by 10,000.rn3.  Age Adjusted Rate
    per 10,000 u2013 Age adjustment to the 2000 Standard US Census  to allow direct
    comparison of rates in counties or states with different age distributions.rnrnThis
    indicator uses data collected by hospitals. It can be used to identify trends and
    patterns in the occurrence of oral health- related hospitalizations across time
    and space. The data are organized by different variables to help estimate the number
    of oral health hospital admissions in different time periods, age groups, and geographic
